import Resume from './components/Resume';
import Main from './components/Main';

function App () {screenX
    return (
        < >
         <CssBaseline/>
         <Router  exact path = "/" component={Main}/>
         <Router  path = "/resume" component={Resume}/>

        </>
    )
}

export default App;
